import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';

const AssessmentHistory = () => {
  const { classId, studentId } = useParams();
  const navigate = useNavigate();
  const [student, setStudent] = useState(null);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchStudentData = async () => {
      try {
        const res = await axios.get(`/api/students/${studentId}`, { withCredentials: true });
        setStudent(res.data);
      } catch (err) {
        console.error(err);
        if (err.response?.status === 401) {
          navigate('/login');
        } else {
          setError('Failed to load student data');
        }
      }
    };

    fetchStudentData();
  }, [studentId, navigate]);

  if (!student) {
    return <div>Loading...</div>;
  }

  return (
    <div className="container mx-auto px-4 py-8">
      <div className="max-w-4xl mx-auto">
        <div className="flex items-center justify-between mb-8">
          <h1 className="text-3xl font-bold">Assessment History</h1>
          <button
            onClick={() => navigate(`/class/${classId}`)}
            className="px-4 py-2 text-gray-600 hover:text-gray-800"
          >
            ← Back to Class
          </button>
        </div>

        {error && (
          <div className="bg-red-50 border border-red-200 text-red-600 px-4 py-3 rounded mb-4">
            {error}
          </div>
        )}

        <div className="bg-white rounded-lg shadow-md">
          <div className="px-6 py-4 border-b">
            <h2 className="text-xl font-semibold">{student.name}'s Assessments</h2>
          </div>
          <div className="divide-y">
            {student.assessments && student.assessments.length > 0 ? (
              student.assessments.map((assessment, index) => (
                <div key={index} className="p-6">
                  <div className="flex justify-between items-start mb-4">
                    <div>
                      <h3 className="text-lg font-medium">
                        Assessment {index + 1} - {new Date(assessment.date).toLocaleDateString()}
                      </h3>
                      <p className="text-sm text-gray-500">
                        Type: {assessment.type}
                      </p>
                    </div>
                    <div className="flex items-center">
                      <div className="w-32 bg-gray-200 rounded-full h-2.5 mr-2">
                        <div
                          className="bg-indigo-600 h-2.5 rounded-full"
                          style={{ width: `${assessment.accuracy}%` }}
                        ></div>
                      </div>
                      <span className="text-sm font-medium">{assessment.accuracy.toFixed(1)}%</span>
                    </div>
                  </div>

                  <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                    <div>
                      <h4 className="font-medium mb-2">Expected Answer</h4>
                      <p className="text-gray-700 bg-gray-50 p-3 rounded">
                        {assessment.expectedAnswer}
                      </p>
                    </div>
                    <div>
                      <h4 className="font-medium mb-2">Student's Response</h4>
                      {assessment.transcript && (
                        <div className="mb-4">
                          <h5 className="text-sm font-medium text-gray-500 mb-1">Speech</h5>
                          <p className="text-gray-700 bg-gray-50 p-3 rounded">
                            {assessment.transcript}
                          </p>
                        </div>
                      )}
                      {assessment.ocrResult && (
                        <div>
                          <h5 className="text-sm font-medium text-gray-500 mb-1">OCR</h5>
                          <p className="text-gray-700 bg-gray-50 p-3 rounded">
                            {assessment.ocrResult}
                          </p>
                        </div>
                      )}
                    </div>
                  </div>
                </div>
              ))
            ) : (
              <div className="px-6 py-4 text-gray-600">
                No assessments recorded yet
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default AssessmentHistory;
